/* 
 * testcase for offsets
 */
public void testOffsets() throws Exception {
	assertAnalyzesTo(new ThaiAnalyzer(), "เดอะนิวยอร์กไทมส์", 
			new String[] { "เด", "อะนิว", "ยอ", "ร์ก", "ไทมส์"},
			new int[] { 0, 2, 7, 9, 12 },
			new int[] { 2, 7, 9, 12, 17});
}

